//     color: 'white',
//     height: 48,
//     padding: '0 30px',
//   }
// })



export function Home() {
  // const classesLanding = useStyle()

  return (

         <ThemeProvider theme={theme}>
          <Grid container sx={{
            hight:'100%',
            width:'100%',
            // marginTop:0
          }}>
            <Grid item xs={12} sm={12} xl={12}>
              <Navbar />
              </Grid>
            <Grid item xs={12} sm={12} xl={12}>
              <ConteinerCards/>
              </Grid>
            <Grid item xs={12} sm={12} xl={12}>
              <Footer/>
              
              </Grid>

          </Grid>
          
         </ThemeProvider> 
    
  );
};




